import { useState } from "react";




function App() {

  const [counter, setCounter] = useState(1)
  const handleIncrease = () =>{
    counter = 1
    if(setCounter){
      counter++
    }
  }
  return (
    <div className="App" style={{padding: 30}}>
      <h1>{counter}</h1>
      <button onClick={handleIncrease}>+</button>
    </div>
  );
}

export default App;
